pragma solidity ^0.7.0;

import "hardhat/console.sol";
import "./SuperGovernance.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";

/**
 * @title AllianceBlock DaoSubscriptions contract
 * @notice Responsible for all dao subscriptions on AllianceBlock's ecosystem
 */
contract DaoSubscriptions is SuperGovernance {
    using SafeMath for uint256;
    using ValuedDoubleLinkedList for ValuedDoubleLinkedList.LinkedList;
    using DoubleLinkedList for DoubleLinkedList.LinkedList;

    function subscribeForDaoMembership()
    external
    checkCronjob()
    {
        require(votingStatusForDaoMembers > VotingStatusMembers.EMPTY_STATE, "Subscriptions for Dao Membership are not open right now");

        staking.provideStakingForDaoMembership(msg.sender);
        subscribedForDaoMembership[msg.sender] = true;

        if(addressToId[msg.sender] == 0) {
            totalIds = totalIds.add(1);
            addressToId[msg.sender] = totalIds;
            idToAddress[totalIds] = msg.sender;
        }
    }

    function unsubscribeDaoMembership()
    external
    checkCronjob()
    {
        require(!isEpochDaoMember[msg.sender][currentEpoch], "Cannot unsubscribe while being active dao member");

        subscribedForDaoMembership[msg.sender] = false;
        staking.unstakeDao(msg.sender, true);
    }

    function voteForDaoMember(address daoSubscriberToVoteFor)
    external
    checkCronjob()
    {
        require(votingStatusForDaoMembers == VotingStatusMembers.VOTING, "Voting for Dao Members is not open right now");
        require(staking.getBalance(msg.sender) > 0, "Only stakers can vote");
        require(subscribedForDaoMembership[daoSubscriberToVoteFor], "Can only vote for active dao membership subscriber");
        require(!hasVotedForDaoMemberPerEpoch[msg.sender][currentEpoch], "Cannot vote again");

        hasVotedForDaoMemberPerEpoch[msg.sender][currentEpoch] = true;

        uint256 votesForSubscriber = daoMembersListForUpcomingEpoch.nodes[addressToId[daoSubscriberToVoteFor]].value;

        if(votesForSubscriber != 0) {
            daoMembersListForUpcomingEpoch.removeNode(addressToId[daoSubscriberToVoteFor]);
        }

        daoMembersListForUpcomingEpoch.addNodeDecrement(votesForSubscriber.add(1), addressToId[daoSubscriberToVoteFor]);
    }

    function claimDaoMembership()
    external
    checkCronjob()
    {
        require(votingStatusForDaoMembers >= VotingStatusMembers.CLAIM_MEMBERSHIP, "Claiming Dao Membership is not open right now");
        uint256 currentPosition = daoMembersListForUpcomingEpoch.getPositionForId(addressToId[msg.sender]);

        require(currentPosition > 0 && currentPosition <=
            amountOfEpochDaoMembersNeededPerEpoch[currentEpoch.add(1)], "Not eligible to become dao member");

        daoMembersListForUpcomingEpoch.removeNode(addressToId[msg.sender]);
        amountOfEpochDaoMembersNeededPerEpoch[currentEpoch.add(1)] =
            amountOfEpochDaoMembersNeededPerEpoch[currentEpoch.add(1)].sub(1);
        isEpochDaoMember[msg.sender][currentEpoch.add(1)] = true;

        epochDaoMembers[currentEpoch.add(1)].addNode(addressToId[msg.sender]);
    }

    function subscribeForDaoDelegator()
    external
    checkCronjob()
    {
        require(isEpochDaoMember[msg.sender][currentEpoch], "Only active dao members can subscribe to become delegators");

        staking.provideStakingForDaoDelegator(msg.sender);
        subscribedForDaoDelegator[msg.sender] = true;
    }

    function unsubscribeDaoDelegation()
    external
    checkCronjob()
    {
        require(!isEpochDaoDelegator[msg.sender][currentEpoch], "Cannot unsubscribe while being active dao delegator");

        subscribedForDaoDelegator[msg.sender] = false;
        staking.unstakeDao(msg.sender, false);
    }

    function voteForDaoDelegator(bytes32 votingHash)
    external
    checkCronjob()
    {
        require(votingStatusForDaoDelegators == VotingStatusDelegators.VOTING, "Voting for Dao Delegators is not open right now");
        require(isEpochDaoMember[msg.sender][currentEpoch], "Only dao members can vote");
        require(!hasVotedForDaoDelegatorPerEpoch[msg.sender][currentEpoch], "Cannot vote again");

        hasVotedForDaoDelegatorPerEpoch[msg.sender][currentEpoch] = true;

        votingHashOfDaoMembersPerEpoch[msg.sender][currentEpoch] = votingHash;
    }

    function approveVoteForDaoDelegator(string calldata password, address daoDelegatorToVoteFor)
    external
    checkCronjob()
    {
        require(votingStatusForDaoDelegators == VotingStatusDelegators.APPROVE_VOTING, "Approve voting for Dao Delegators is not open right now");
        require(votingHashOfDaoMembersPerEpoch[msg.sender][currentEpoch] ==
            keccak256(abi.encodePacked(password, daoDelegatorToVoteFor)), "Wrong approval password or delegator");
        require(subscribedForDaoDelegator[daoDelegatorToVoteFor], "Can only vote for active dao delegator subscriber");
        require(isEpochDaoMember[daoDelegatorToVoteFor][currentEpoch], "Can only vote delegator that is active dao member");
        require(!hasApprovedForDaoDelegatorPerEpoch[msg.sender][currentEpoch], "Cannot approve vote again");

        hasApprovedForDaoDelegatorPerEpoch[msg.sender][currentEpoch] = true;

        if (!bannedDelegator[addressToId[daoDelegatorToVoteFor]][currentEpoch.add(1)]) {
            uint256 votesForSubscriber = daoDelegatorsListForUpcomingEpoch.nodes[addressToId[daoDelegatorToVoteFor]].value;

            if(votesForSubscriber != 0) {
                daoDelegatorsListForUpcomingEpoch.removeNode(addressToId[daoDelegatorToVoteFor]);
            }

            daoDelegatorsListForUpcomingEpoch.addNodeDecrement(votesForSubscriber.add(1), addressToId[daoDelegatorToVoteFor]);
        }
    }

    function claimDaoDelegation()
    external
    checkCronjob()
    {
        require(votingStatusForDaoDelegators >= VotingStatusDelegators.CLAIM_DELEGATION, "Claiming Dao Delegation is not open right now");
        uint256 currentPosition = daoDelegatorsListForUpcomingEpoch.getPositionForId(addressToId[msg.sender]);

        require(currentPosition > 0 && currentPosition <=
            amountOfEpochDaoDelegatorsNeededPerEpoch[currentEpoch.add(1)], "Not eligible to become dao delegator");

        daoDelegatorsListForUpcomingEpoch.removeNode(addressToId[msg.sender]);
        amountOfEpochDaoDelegatorsNeededPerEpoch[currentEpoch.add(1)] =
            amountOfEpochDaoDelegatorsNeededPerEpoch[currentEpoch.add(1)].sub(1);

        isEpochDaoDelegator[msg.sender][currentEpoch.add(1)] = true;

        epochDaoDelegators[currentEpoch.add(1)].addNode(addressToId[msg.sender]);
    }

    function claimDaoSubstituteDelegation()
    external
    checkCronjob()
    {
        require(amountOfSubstitutesRequested[currentEpoch] > 0, "No substitutes requested");
        uint256 currentPosition = daoSubstituteDelegatorsListForCurrentEpoch.getPositionForId(addressToId[msg.sender]);

        require(currentPosition > 0 && currentPosition <=
            amountOfEpochDaoDelegatorsNeededPerEpoch[currentEpoch], "Not eligible to become dao delegator substitute");

        amountOfSubstitutesRequested[currentEpoch] = amountOfSubstitutesRequested[currentEpoch].sub(1);
        epochDaoDelegators[currentEpoch].addNode(addressToId[msg.sender]);
        isEpochDaoDelegator[msg.sender][currentEpoch] = true;

        addSubstituteToAllActiveRequests(addressToId[msg.sender], currentEpoch);
    }

    function isDaoAssociated(address account, uint256 epoch)
    external
    view
    returns(bool, bool, uint256, uint256)
    {
        return (
            isEpochDaoMember[account][epoch],
            isEpochDaoDelegator[account][epoch],
            epochDaoMembers[epoch].getSize(),
            epochDaoDelegators[epoch].getSize()
        );
    }
}
","keccak256":"0x492199a67530d2c6d8442c6bc7c5ccde1d1cf502f1f344c2bf3099ff83ee1c24","license":"MIT"},"contracts/governance/GovernanceTypesAndStorage.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;

import "../interfaces/IRegistry.sol";
import "../interfaces/IStaking.sol";
import "../libs/ValuedDoubleLinkedList.sol";
import "../libs/DoubleLinkedList.sol";

/**
 * @title AllianceBlock GovernanceStorage contract
 * @notice Responsible for governance storage
 */
contract GovernanceTypesAndStorage {
    using ValuedDoubleLinkedList for ValuedDoubleLinkedList.LinkedList;
    using DoubleLinkedList for DoubleLinkedList.LinkedList;

    enum VotingStatusMembers {
        EMPTY_STATE, // The state where stakers cannot even subscribe for dao membership.
        PRE_STATE, // The state where stakers can only subscribe for future dao membership.
        VOTING, // The state where stakers are voting for dao delegators and members.
        CLAIM_MEMBERSHIP, // The state where dao members are claiming their membership.
        LATE_MEMBERSHIP_CLAIMING // The state where unclaimed spots for dao membership are filled.
    }

    enum VotingStatusDelegators {
        PRE_STATE, // The state where active dao members can only subscribe to become future dao delegators.
        VOTING, // The state where active dao members are voting for dao delegators.
        APPROVE_VOTING, // The state where dao members are approving the voting for dao delegators.
        CLAIM_DELEGATION, // The state where dao delegators are claiming their delegation privilages.
        LATE_DELEGATION_CLAIMING // The state where unclaimed spots for dao delegation are filled.
    }

    struct ApprovalRequest {
        uint256 loanId; // The loan id for which approcal is requested.
        bool isMilestone; // true if approval reuested is connected to a milestone and false if not.
        uint256 milestoneNumber; // The milestone number if is Milestone based request.
        uint256 deadlineTimestamp; // The deadline timestamp to approve this request.
        uint256 approvalsProvided; // The number of approvals that this request has gathered.
        bool isApproved; // True if request is approved, false if not.
        uint256 epochSubmitted; // The epoch that the request was submitted.
    }

    // EVENTS
    event VotedForRequest(uint indexed loanId, uint indexed requestId, bool decision, address indexed user);
    event ApprovalRequested(uint indexed loanId, bool indexed isMilestone, uint milestoneNumber, address indexed user);
    event InitGovernance(address indexed registryAddress_, address indexed stakingAddress_, address indexed user);

    VotingStatusMembers public votingStatusForDaoMembers;
    VotingStatusDelegators public votingStatusForDaoDelegators;

    mapping(address => mapping(uint256 => bool)) public isEpochDaoMember;
    mapping(address => mapping(uint256 => bool)) public isEpochDaoDelegator;
    mapping(address => mapping(uint256 => bool)) public hasVotedForRequestId;
    mapping(uint256 => mapping(uint256 => bool)) public bannedDelegator;
    mapping(uint256 => uint256) public amountOfEpochDaoMembersNeededPerEpoch;
    mapping(uint256 => uint256) public amountOfEpochDaoDelegatorsNeededPerEpoch;

    mapping(address => bool) public subscribedForDaoMembership;
    mapping(address => bool) public subscribedForDaoDelegator;

    mapping(uint256 => uint256) public rewardsForDaoMembersPerEpoch;
    mapping(uint256 => uint256) public rewardsForDaoDelegatorsPerEpoch;

    ValuedDoubleLinkedList.LinkedList public daoSubstituteMembersListForCurrentEpoch;
    ValuedDoubleLinkedList.LinkedList public daoSubstituteDelegatorsListForCurrentEpoch;
    ValuedDoubleLinkedList.LinkedList public daoMembersListForUpcomingEpoch;
    ValuedDoubleLinkedList.LinkedList public daoDelegatorsListForUpcomingEpoch;

    mapping(uint256 => DoubleLinkedList.LinkedList) public requestsPerEpoch;
    mapping(uint256 => DoubleLinkedList.LinkedList) public remainingDelegatorIdsToVotePerRequest;
    mapping(uint256 => DoubleLinkedList.LinkedList) public remainingMemberIdsToVoteForDelegator;
    mapping(uint256 => DoubleLinkedList.LinkedList) public remainingMemberIdsToVotePerRequest; // For governance changes requests - TODO

    mapping(uint256 => DoubleLinkedList.LinkedList) public epochDaoMembers;
    mapping(uint256 => DoubleLinkedList.LinkedList) public epochDaoDelegators;

    mapping(address => mapping(uint256 => bool)) public hasVotedForDaoMemberPerEpoch;
    mapping(address => mapping(uint256 => bool)) public hasVotedForDaoDelegatorPerEpoch;
    mapping(address => mapping(uint256 => bool)) public hasApprovedForDaoDelegatorPerEpoch;

    mapping(address => mapping(uint256 => bytes32)) public votingHashOfDaoMembersPerEpoch;

    mapping(address => uint256) public addressToId;
    mapping(uint256 => address) public idToAddress;

    uint256 public totalApprovalRequests; // The total amount of approvals requested.

    address public superDelegator;

    mapping(uint256 => ApprovalRequest) public approvalRequests;

    IRegistry public registry;
    IStaking public staking;

    uint256 public totalIds;
    uint256 public currentEpoch;

    mapping(uint256 => uint256) public amountOfSubstitutesRequested; // This is true when a delegator substitute request is active

    mapping(bytes32 => uint256) public updatableVariables;

    // CRONJOB types and variables
    enum CronjobType {
        DAO_APPROVAL, // Cronjob type for approvals on registry requests.
        DAO_VOTING_REQUEST, // Cronjob type for dao ecosystem change requests.
        DAO_MEMBERSHIP_VOTING, // Cronjob type for dao membership voting.
        DAO_DELEGATORS_VOTING, // Cronjob type for dao delegation voting.
        DAO_REWARDS_PROVISION, // Cronjob type for rewards provision in case there is a pending request and rewards after epoch change.
        DAO_SUBSTITUTES // Cronjob type for dao substitutes to enter till list is renewed (if not filled).
    }

    struct Cronjob {
        CronjobType cronjobType; // This is the cronjob type.
        uint256 externalId; // This is the id of the request in case of dao approval or change voting request.
    }

    // TODO - Make this simple linked list, not double (we don't need to remove anything else than head MAYBE).
    ValuedDoubleLinkedList.LinkedList public cronjobList;
    uint256 public totalCronjobs;

    mapping(uint256 => Cronjob) public cronjobs; // cronjobId to Cronjob.

    // MODIFIERS

    modifier onlyRegistry() {
        require(msg.sender == address(registry), "Only Registry contract");
        _;
    }

    modifier onlyDaoDelegatorNotVoted(uint256 requestId, uint256 epochSubmitted) {
        require(isEpochDaoDelegator[msg.sender][epochSubmitted], "Only Dao Delegator for the epoch request was submitted");
        require(!hasVotedForRequestId[msg.sender][requestId], "Only if not voted yet");
        _;

        hasVotedForRequestId[msg.sender][requestId] = true;
    }

    modifier onlyBeforeDeadline(uint256 requestId) {
        require(approvalRequests[requestId].deadlineTimestamp > block.timestamp,
            "Only before deadline is reached");
        _;
    }

    modifier onlyAfterDeadlineAndNotApproved(uint256 requestId) {
        require(approvalRequests[requestId].deadlineTimestamp <= block.timestamp,
            "Only after deadline is reached");
        require(!approvalRequests[requestId].isApproved, "Only if not already approved");
        _;
    }
}
","keccak256":"0x9d90456dd90d1495ec8a28f93ab9c3d49c09a6daac8a5d050ac2b3b84e4d71f2","license":"MIT"},"contracts/governance/SuperGovernance.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;

import "hardhat/console.sol";
import "./DaoCronjob.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

/**
 * @title AllianceBlock Governance contract
 * @notice Responsible for govern AllianceBlock's ecosystem
 */
contract SuperGovernance is OwnableUpgradeable, DaoCronjob {
    using SafeMath for uint256;

    function setRegistryAndStaking(
        address registryAddress_,
        address stakingAddress_
    )
    external
    onlyOwner()
    {
        require(address(registry) == address(0), "Cannot initialize second time");
        registry = IRegistry(registryAddress_);
        staking = IStaking(stakingAddress_);

        emit InitGovernance(registryAddress_, stakingAddress_, msg.sender);
    }

    function superVoteForRequest(
        uint256 requestId,
        bool decision
    )
    external
    checkCronjob()
    {
        require(msg.sender == superDelegator, "Only super delegator can call this function");
        require(currentEpoch <= 1, "Super delegating works only till first epoch");

        if(approvalRequests[requestId].isMilestone) {
            registry.decideForMilestone(approvalRequests[requestId].loanId, decision);
        } else {
            registry.decideForLoan(approvalRequests[requestId].loanId, decision);
        }

        if(decision) {
            approvalRequests[requestId].approvalsProvided = approvalRequests[requestId].approvalsProvided.add(1);
            approvalRequests[requestId].isApproved = true;
        }

        emit VotedForRequest(approvalRequests[requestId].loanId, requestId, decision, msg.sender);
    }

    function openDaoMembershipSubscriptions()
    external
    onlyOwner()
    {
        votingStatusForDaoMembers = VotingStatusMembers.PRE_STATE;
    }

    function openDaoMembershipVoting()
    external
    onlyOwner()
    {
        votingStatusForDaoMembers = VotingStatusMembers.VOTING;
    }

    function openDaoDelegatingSubscriptions(
        uint256 amountOfDaoMembers_,
        uint256 daoClaimingDuration_,
        uint256 daoLateClaimingDuration_
    )
    external
    onlyOwner()
    {
        updatableVariables[keccak256(abi.encode("amountOfDaoMembers"))] = amountOfDaoMembers_;
        updatableVariables[keccak256(abi.encode("daoClaimingDuration"))] = daoClaimingDuration_;
        updatableVariables[keccak256(abi.encode("daoLateClaimingDuration"))] = daoLateClaimingDuration_;

        votingStatusForDaoMembers = VotingStatusMembers.CLAIM_MEMBERSHIP;

        addCronjob(CronjobType.DAO_MEMBERSHIP_VOTING, block.timestamp.add(daoClaimingDuration_), 0);

        amountOfEpochDaoMembersNeededPerEpoch[currentEpoch.add(1)] = amountOfDaoMembers_;
    }

    function openDaoDelegatingVoting()
    external
    onlyOwner()
    {
        votingStatusForDaoDelegators = VotingStatusDelegators.VOTING;
    }

    function openDaoDelegating(
        uint256 amountOfDaoDelegators_,
        uint256 daoMembershipVotingDuration_,
        uint256 daoDelegationVotingDuration_,
        uint256 daoDelegationApprovalDuration_,
        uint256 daoDelegationSubstituteClaimDuration_
    )
    external
    onlyOwner()
    {
        updatableVariables[keccak256(abi.encode("amountOfDaoDelegators"))] = amountOfDaoDelegators_;
        updatableVariables[keccak256(abi.encode("daoMembershipVotingDuration"))] = daoMembershipVotingDuration_;
        updatableVariables[keccak256(abi.encode("daoDelegationVotingDuration"))] = daoDelegationVotingDuration_;
        updatableVariables[keccak256(abi.encode("daoDelegationApprovalDuration"))] = daoDelegationApprovalDuration_;
        updatableVariables[keccak256(abi.encode("daoDelegationSubstituteClaimDuration"))] = daoDelegationSubstituteClaimDuration_;

        votingStatusForDaoDelegators = VotingStatusDelegators.APPROVE_VOTING;

        addCronjob(CronjobType.DAO_DELEGATORS_VOTING, block.timestamp.add(daoDelegationApprovalDuration_), 0);

        uint256 timestampToOpenDaoMembershipVoting =
            block.timestamp.add(daoDelegationApprovalDuration_).add(
            updatableVariables[keccak256(abi.encode("daoClaimingDuration"))]).add(
            updatableVariables[keccak256(abi.encode("daoLateClaimingDuration"))]);

        addCronjob(CronjobType.DAO_MEMBERSHIP_VOTING, timestampToOpenDaoMembershipVoting, 0);
    }
}
