","keccak256":"0xcaa6af91c26a88f730c713247abef08099ff154136846fc3c77d460f0283a345","license":"MIT"},"contracts/libs/DoubleLinkedList.sol":{"content":"pragma solidity ^0.7.0;

library DoubleLinkedList {
    struct Node {
        uint256 next;
        uint256 previous;
    }

    struct LinkedList {
        uint256 head;
        uint256 tail;
        uint256 size;
        mapping(uint256 => Node) nodes;
    }

    function getHeadId(LinkedList storage self) internal view returns (uint256) {
        return self.head;
    }

    function getSize(LinkedList storage self) internal view returns (uint256) {
        return self.size;
    }

    function addNode(
        LinkedList storage self,
        uint256 id
    ) internal {
        //If empty
        if (self.head == 0) {
            self.head = id;
            self.tail = id;
            self.nodes[id] = Node(0, 0);
        }
        //Else push in tail
        else {
            self.nodes[self.tail].next = id;
            self.nodes[id] = Node(0, self.tail);
            self.tail = id;
        }

